CREATE TABLE credit_applications (
  customer_id INT,
  name VARCHAR(255),
  dob DATE,
  gender VARCHAR(255),
  email VARCHAR(255),
  phone VARCHAR(255),
  income DECIMAL(10,2),
  application_date DATE,
  loan_amount DECIMAL(10,2),
  loan_type VARCHAR(255),
  loan_status VARCHAR(255),
  purpose VARCHAR(255),
  credit_score INT
);

CREATE TABLE payment_history (
  payment_id INT,
  customer_id INT,
  payment_date DATE,
  amount_paid INT,
  late_payment BOOLEAN,
  payment_method VARCHAR(255)
);
